import React from "react";

// reactstrap components
import {
  Button,
  Card,
  CardBody,
  CardImg,
  CardTitle,
  CardText,
} from "reactstrap";

const style = { width: "18rem" };

function Fleets() {
  return (
    <>
    <div className="container mt-5">
        <div className="row">
            <div className="col-12">
            <Card style={style}>
        <CardImg
                alt="..."
                //   src={require("../images/youthJoin.png")}
                  src={"/images/youthJoin.png" }
                  src={"/images/youthJoin.png" }
                  src={"/images/youthJoin.png" }
                  src={"/images/youthJoin.png" }
                  src={"/images/youthJoin.png" }
                  src={"/images/youthJoin.png" }
                  src={"/images/youthJoin.png" }
                top
                ></CardImg>
                <CardBody>
                <CardTitle>Card title</CardTitle>
                <CardText>
                    Some quick example text to build on the card title and make up the
                    bulk of the card's content.
                </CardText>
                <Button
                    color="primary"
                    href="#pablo"
                    onClick={(e) => e.preventDefault()}
                >
                    Go somewhere
                </Button>
                </CardBody>
            </Card>
            </div>

        </div>

    </div>
      
    </>
  );
}

export default Fleets;
